import React from 'react';
import './results.css';

const Results = () => {
  return (
    <div className="centered-container">
      <div className="company-info">
        <h1 className="company-name">Adani Enterprises</h1>
        <div className='middle-section'>
        <span className="sentiment">Sentiment:<span className='text-green'> Positive</span><></>  Current price:<span className='text-green' > $99</span>  </span>
        </div>

      </div>
      <div className="articles">
        <h2>Top 5 articles of the day:</h2>
        <ul>
          <li>Article 1</li>
          <li>Article 2</li>
          <li>Article 3</li>
          <li>Article 4</li>
          <li>Article 5</li>
        </ul>
      </div>
    </div>
  );
};

export default Results;
